import React from 'react';
import { withRouter } from 'react-router-dom';
import Stars from './Stars';
import app from '../styles/LandingPage.module.css';

const CarouselCard = ({ id, type, history }) => {
  const clickHandler = () => {
    history.push(`/details/${id}`, null);
  }

  return (
    <div id={id} className={app[type === 'testemunial' ? 'carousel__item' : 'carousel__item--product']}>
      {
        type === 'testemunial'
          ? (
            <>
              <img className={app['profile-pic']} src="https://upload.wikimedia.org/wikipedia/commons/8/89/Portrait_Placeholder.png" alt="Profile picure" />
              <h4 className={app['card-title']}>Kate Swome</h4>
              <small>Designer</small>
              <p className={app['card-description']}>
                <q>
                  "Circle is an excellent service to use and already a part of my weekly routine. I finally have people I enjoy the company of and can be myself with."
            </q>
              </p>
            </>
          )
          : (
            <>
              <img onClick={clickHandler}  className={app['product-pic']} src="https://static01.nyt.com/images/2020/01/08/realestate/08IHH-URUGUAY-slide-NAQ6/08IHH-URUGUAY-slide-NAQ6-mobileMasterAt3x.jpg" alt="Product picture">
              </img>
              <div className={app['product-summary']}>
                <div className={app['summary-left']}>
                  <h4 className={app['card-title']}>Beautiful country house</h4>
                  <Stars points={2} />
                </div>
                <div className={app['summary-right']}>
                  <p className={app['card-title']}>$2 500</p>
                  <p className={app['summary-right__unit']}>per Month</p>
                </div>
              </div>
            </>
          )
      }
    </div>
  )
};

export default withRouter(CarouselCard);
